import React from 'react';
import CustomerProfile from './CustomerProfile';

function ProfileScreen() {
  return (

    <div>
      <CustomerProfile
        name = "Omer Iqbal"
        email = "omer@hotmail.com"
        number = "123456789"
        dob = "08/02/1998"
        password = "pass123"
        gender = "Male"
        address = "122-K Phase-1 DHA Lahore"
      />
    </div>
  );
}

export default  ProfileScreen;
